export enum TILE_STATUS {
    WHITE = 'WHITE',
    BLACK = 'BLACK',
    AVAILABLE = 'AVAILABLE',
    OCCUPIED = 'OCCUPIED',
    SELECTED = 'SELECTED'
}

export enum PLAYER {
    BLACK = 'BLACK',
    WHITE = 'WHITE',
} 

export enum PLAYERACTIONTYPE{
    SELECT_WHITE = 'SELECT_WHITE',
    SELECT_BLACK = 'SELECT_BLACK',
}
